import React, { useState, useEffect } from 'react';
import { ATTRIBUTE_LIST } from "../consts";
import ClassAttribute from './classAttribute';

const Attribute = () => {
  const getInitialAttributes = () => {
    const storedAttributes = localStorage.getItem('attributes');
    if (storedAttributes) {
      return JSON.parse(storedAttributes);
    }
    return ATTRIBUTE_LIST.map((attr) => ({ name: attr, value: 0 }));
  };

  const getInitialSkillModifiers = () => {
    const storedModifiers = localStorage.getItem('skillModifiers');
    if (storedModifiers) {
      return JSON.parse(storedModifiers);
    }
    return { Acrobatics: 0, Perception: 0 }; // Default skill modifiers
  };

  const [attributes, setAttributes] = useState(getInitialAttributes);
  const [skillModifiers, setSkillModifiers] = useState(getInitialSkillModifiers);

  useEffect(() => {
    localStorage.setItem('attributes', JSON.stringify(attributes));
    localStorage.setItem('skillModifiers', JSON.stringify(skillModifiers));
  }, [attributes, skillModifiers]);

  const getTotalValue = () => {
    return attributes.reduce((total, attr) => total + attr.value, 0);
  };

  const handleIncrement = (index) => {
    const totalValue = getTotalValue();
    if (totalValue >= 70) {
      alert("Max total attribute value cannot exceed 70.");
      return;
    }
    if (attributes[index].value < 20) {
      const updatedAttributes = [...attributes];
      updatedAttributes[index].value += 1;
      setAttributes(updatedAttributes);
    }
  };

  const handleDecrement = (index) => {
    const updatedAttributes = [...attributes];
    if (updatedAttributes[index].value > 0) {
      updatedAttributes[index].value -= 1;
      setAttributes(updatedAttributes);
    }
  };

  const getIntelligenceModifier = () => {
    const intelligenceAttr = attributes.find(attr => attr.name === 'Intelligence');
    return intelligenceAttr ? intelligenceAttr.value : 0;
  };

  const calculatePointsToSpend = () => {
    const intelligenceModifier = getIntelligenceModifier();
    return 10 + (4 * intelligenceModifier);
  };

  const handleSkillModifierChange = (skill, delta) => {
    const totalPointsToSpend = calculatePointsToSpend();
    const totalSpent = Object.values(skillModifiers).reduce((sum, mod) => sum + mod, 0);
    if (totalSpent + delta > totalPointsToSpend) {
      alert(`Cannot spend more than ${totalPointsToSpend} points on skills.`);
      return;
    }

    const updatedModifiers = { ...skillModifiers };
    updatedModifiers[skill] = Math.max(0, updatedModifiers[skill] + delta); // Ensure minimum of 0
    setSkillModifiers(updatedModifiers);
  };

  return (
    <div className="p-4 space-y-4 flex-row">
      <h2 className="text-xl font-bold">Attribute List</h2>
      {attributes.map((attr, index) => (
        <div
          key={attr.name}
          className="flex items-center justify-between p-4 border border-gray-300 rounded-lg"
        >
          <span className="w-32 font-medium">{attr.name}</span>
          <div className="flex items-center space-x-4">
            <button
              className="px-3 py-1 bg-red-500 text-white rounded hover:bg-red-600"
              onClick={() => handleDecrement(index)}
              disabled={attr.value <= 0}
            >
              -
            </button>
            <span className="w-8 text-center text-lg">{attr.value}</span>
            <button
              className="px-3 py-1 bg-green-500 text-white rounded hover:bg-green-600"
              onClick={() => handleIncrement(index)}
              disabled={attr.value >= 20}
            >
              +
            </button>
          </div>
        </div>
      ))}

      <h2 className="text-xl font-bold">Skill Modifiers</h2>
      <div className="flex flex-col space-y-4">
        {Object.keys(skillModifiers).map((skill) => (
          <div key={skill} className="flex items-center justify-between p-4 border border-gray-300 rounded-lg">
            <span className="w-32 font-medium">{skill}</span>
            <div className="flex items-center space-x-4">
              <button
                className="px-3 py-1 bg-red-500 text-white rounded hover:bg-red-600"
                onClick={() => handleSkillModifierChange(skill, -1)}
                disabled={skillModifiers[skill] <= 0}
              >
                -
              </button>
              <span className="w-8 text-center text-lg">{skillModifiers[skill]}</span>
              <button
                className="px-3 py-1 bg-green-500 text-white rounded hover:bg-green-600"
                onClick={() => handleSkillModifierChange(skill, 1)}
              >
                +
              </button>
            </div>
          </div>
        ))}
      </div>

      <ClassAttribute attributes={attributes} />
    </div>
  );
};

export default Attribute;
